[Hookable(false)]
internal InventDim convertToInventDim(boolean _ensureExists = false)
{
    InventDim inventDim;

    this.copyInventoryDimensionsTo(inventDim);

    if (_ensureExists)
    {
        inventDim = InventDim::findOrCreate(inventDim);
    }

    return inventDim;
}

